        //#region Get File Extention
        function getFileExtension(HeaderReceiptPath) {
            var fileinput = document.getElementById(HeaderReceiptPath);
            if (!fileinput)
                return "";
            var filename = fileinput.value;
            if (filename.length == 0)
                return "";
            var dot = filename.lastIndexOf(".");
            if (dot == -1)
                return "";
            var extension = filename.substr(dot, filename.length);
            return extension;
        }
