    //#region CheckCostAccountForRemoveTransaction
    function CheckCostAccountForRemoveTransaction(hasCotsAccounts, hasSplitTransactions, HasPreApprovalAttached,ExpenseDetailId,HasAdvancedHCPCotsAccounts) 
    {       
        
        if (confirm("Remove Transaction?")) {        
            var hasMultiLineApproval = false;
            var canRemoveTrnx = false;
            var validUserRole = false;
            var currentActionName = "AddTransactionToReport";
            var closeIcon= "/images/icons/cross_grey_small.png";
            //clear earlier messages
            $('.notification.error.png_bg').remove();          
            if (hasCotsAccounts == "True") {
                var message = '<div class="notification error png_bg"><a href="#" class="close"><img src="'+closeIcon+'" title="Close this notification" alt="close"></a>';
                message += '<div>Cannot remove transaction - please remove cost allocations and try again</div>';
                message += '</div>';
                $('#ExpenseTransactionTab').before(message);
                return false;
            }
            if (HasAdvancedHCPCotsAccounts=="True") {
                var message = '<div class="notification error png_bg"><a href="#" class="close"><img src="'+closeIcon+'" title="Close this notification" alt="close"></a>';
                message += '<div>Cannot remove transaction - please remove HCP cost allocations and try again</div>';
                message += '</div>';
                $('#ExpenseTransactionTab').before(message);
                return false;
            }
            else if (HasPreApprovalAttached == "True") {
                var message = '<div class="notification error png_bg"><a href="#" class="close"><img src="'+closeIcon+'" title="Close this notification" alt="close"></a>';
                message += '<div>Cannot remove transaction - Pre-Approval attached to this transaction</div>';
                message += '</div>';
                $('#ExpenseTransactionTab').before(message);
                return false;
            }
            else if (hasSplitTransactions == "True") {
                var message = '<div class="notification error png_bg"><a href="#" class="close"><img src="'+closeIcon+'" title="Close this notification" alt="close"></a>';
                message += '<div>Cannot remove transaction - please remove split transactions and try again</div>';
                message += '</div>';
                $('#ExpenseTransactionTab').before(message);
                return false;
            }
            else if (validUserRole==true && hasMultiLineApproval==true && canRemoveTrnx==false && currentActionName!="AddTransactionToReport") {
                var message = '<div class="notification error png_bg"><a href="#" class="close"><img src="'+closeIcon+'" title="Close this notification" alt="close"></a>';
                message += '<div>You cannot remove last transaction. Reject entire report instead.</div>';
                message += '</div>';
                $('#ExpenseTransactionTab').before(message);
                return false;
            }
            else {
                $('.notification.error.png_bg').remove();
                //region ReviewEditExpense Screen providing a popup while removing transactions and will allow the admin/manager to enter comments.
                var CurrentUserRole = false;
                var ActionName = "AddTransactionToReport";              
                if (CurrentUserRole && ActionName=="ReviewEditExpense") 
                { 
                    var GET_RemoveTrans_URL_ReviewComment = document.getElementById("URLRemoveTransaction"+ExpenseDetailId).value + "";
                    document.getElementById("URLRemoveTransactionWithRemovalComment").value =GET_RemoveTrans_URL_ReviewComment;                     
                    $("#Removepopup").dialog({ title: "Add Removal Remark", height: 160, width: 380, modal: true }).dialog("open"); // Changes on 2016-12-31 to resolve bug 5443 UAT Feedback Point 32) Increase the size (height) of the remove transaction box and move it to the center.
                }
                else {
                    var GET_RemoveTrans_URL = document.getElementById("URLRemoveTransaction"+ExpenseDetailId).value + "";
                    window.location.href = GET_RemoveTrans_URL;
                }
                //endregion
                //return true;
            }
} else {
    return false;
}
