                        $("#NetworkNumber_validationMessage").hide();

                    }
                    
                    if (data.ReferenceNumber == true) {
                        $("#trReferenceNumber").show();
                        // $("#txtProjectNumber").show();
                        $("#ReferenceNumber_validationMessage").show();
                    }
                    else {
                        $("#trReferenceNumber").hide();
                        //$("#txtProjectNumber").hide();
                        $("#ReferenceNumber_validationMessage").hide();
                    }

                    if (data.WBSElement == true) {
                        $("#trCashInAdvance").show();
                        $("#WBSElement_validationMessage").show();
                    }
                    else {
                        $("#trCashInAdvance").hide();
                        $("#WBSElement_validationMessage").hide();
                    }
                    if(data.HeaderReceipt==true)
                    {
                        $("#trHeaderReceipt").show();
                        $("#HeaderReceiptPath").show();                        
                    }
                    else
                    {
                        $("#trHeaderReceipt").hide();
                        $("#HeaderReceiptPath").hide();
                    }
                    $("#NetworkNumber_chzn").width(156);
                    $("#ProjectNumber_chzn").width(156);     
                    $('.chzn-drop').css({minWidth: '156px', width: 'auto'});
                }
            });
        }

        function RemoveAllCostAllocations(actionUrl) {
            $.ajax({
                type: "POST",
                url: actionUrl,
                success: function (data) {
                    window.location.reload();
                }
            });
        }
